import logo from "./logo.svg";
import "./App.css";
import CombatantFormInput from "./components/CombatantFormInput";
import { Box, Container } from "@mui/material";

function App() {
  return (
    <Box sx={{ flexDirection: "row" }}>
      <CombatantFormInput name="Players" />
      <CombatantFormInput name="Enemies" />
    </Box>
  );
}

export default App;
